import 'package:ieca_mobile/enums/hymns_content_code.dart';
import 'package:ieca_mobile/models/_import.dart';
import 'package:ieca_mobile/seeders/_import.dart';

class UmHymnsOtokuaLokufakuaYesu{
  static List<HymnsContent> list = [
    HymnsContent(id: 1840, position: 1, content: "Nda mbanja komindikiso,\nKuna kua fila lohali\nUna ka la linga ekandu,\nHaico ndimbuka ohenda ya'e.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_58, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1841, position: 2, content: "Nda mbanja komindikiso,\nMembula ukuasi woluali.\nSi lipandiya lesunga,\nÑolela lika eyovo lia'e.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_58, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1842, position: 3, content: "Nda mbanja komindikiso,\nMandula ca lua osonde ya'e.\nYa tunda kutue, kovoko,\nKonele kuenda kolomai.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_58, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1843, position: 4, content: "Nda mbanja komindikiso,\nÑomoha ohenda locali.\nNda nda fukile oluali,\nNda nda lu eca ku Yesu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_58, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1844, position: 1, content: "Kupãla ku li okamunda\nKa tua la ka mõla.\nPuãi tu ka sole momo oko\nYesu wa tu fila.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1845, position: 2, content: "Ohali ya lua a tu talela\nKa yi lomboluiwa.\nPuãi tu ci okuti wa tu fila,\nOmo wa tu sola.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1846, position: 3, content: "Wa fila ovakandu etu\nOco tu yowuiwe.\nHa tu litepa levi vĩvĩ,\nLoku linga esunga.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1847, position: 4, content: "Ka ku li vali u o telã\nOku tu popela.\nLovaka aye a tomiwa,\nWa tu avela omuenyo.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_59, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1848, position: 5, content: "Ohenda ya lua a tu linga\nYi tu komohisa.\nYi tu vetaiya ha tu lingi,\nVakuahenda ndeye.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_59, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1849, position: 1, content: "Kongongota... Kekulusu...\nWa filako... Ñala Yesu...\nOsonde yahe... Wayi mesila...\nOmuenyo wahe... Wo nulila...", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_60, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1850, content: "Kongongota! Kongongota!\nOmuenyo wa'e wo nulila.\nKongongota! Kongongota!\nYesu Onjovoli wa fila.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_60, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1851, position: 2, content: "Kekulusu... Wa malusula...\nUpange wo... ku njovola...\nWa nyola ongusu... yeyambo...\nWai ilika onji....la yo kilu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_60, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1852, position: 3, content: "Ñala Yesu... ocili nga…\nOku fa wa... ku mahela…\nLosõi lepe... mbe, lesepu…\nOku njovo... la kakandu?", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_60, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1853, position: 1, content: "Nda wa yeva ayonjo\nKuende ko Ngesemane.\nTala ongongo ya Yesu,\nSokolola ohali ya'e.\nUpa ongangu ku Yesu,\nLomba ndomo a lombele.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_61, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1854, position: 2, content: "Kuende laye kekanga\nKuna vo sombisile.\nVanja efuki vo wasa,\nLomo a kasi lupongo.\nUpa ongangu ku Yesu,\nKu ka tile epembe.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_61, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1855, position: 3, content: "Londa kuna ko Ngongota\nFendela kekulusu.\nOko Yesu a fila,\nOcilumba cakandu.\nUpa ongangu ku Yesu,\nTikula omindikiso.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_61, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1856, position: 4, content: "Limeleha keyambo\nKuna a kendiwile.\nKa limbuke unene wa'e,\nNdomo a yula okufa.\nOmo eye a pinduka,\nTu pinduka kumue la'e.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_61, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1857, position: 1, content: "Uteke una vocumbo\nMuosi mua kala owelema.\nOmo Yesu a lombela\nOngusu lelembeleko.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_62, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1858, position: 2, content: "Uteke waco wesumuo\nYesu wa kala lika lia'e.\nOndembeleki ya piãla\nKa kuete u u kuatisa.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_62, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1859, position: 3, content: "Uteke waco wupongo\nYesu wa italua asangu.\nPuãi ndaño omanu vo limbua\nHaimo Suku wo kolisa.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_62, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1860, position: 4, content: "Uteke waco Onjovoli\nWa yula usumba lohele.\nLongusu Suku wo muisa\nWa votokela okufa.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_62, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1861, position: 1, content: "Upange wa pua pe\nWoku tu popela.\nEsunga lieya ale,\nLi imula esanda.\nOhenda yina ya Suku, (2x)\nYi iyaiya ocali kokuetu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_63, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1862, position: 2, content: "Ocilumba ca lumbua.\nOngumbo ya toka.\nOsonde ya eciwa,\nYundeti wa file.\nTu kala ndati kupãla? (2x)\nOsonde yu tu laleka.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_63, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1863, position: 3, content: "Kalie onjila\nYomuenho yi yela.\nYocali yombembua,\nYi panda ku Suku.\nTu ka pitila lesanju, (2x)\nKofeka yaye yi kola", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_63, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1864, position: 4, content: "Oko kua tumãla\nOcitunda cetu.\nOsonde ya'e yiwa\nYu tu yelisa lie.\nUsumba u pua muele pe! (2x)\nTu kala laye lesanju.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_63, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1865, position: 1, content: "Vemehi liekulusu\nOmo mua ndingila,\nUndembo wa posoka\nKofeka yohali.\nImbo kekalasoko;\nOwusa vonjila.\nOmo mbundaila utanya\nLa viosi vi mbala.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_64, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1866, position: 2, content: "Vemehi liekulusu\nOmo mua posoka.\nHaimo mua ñualehela\nOhenda lesunga.\nNdeci Yakomba wa lota\nOnjoi yina yiwa,\nHaico Yesu wa ndingila\nOsikata te kilu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_64, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1867, position: 3, content: "Nda nola ekulusu\nNdukuasi wa piãla,\nSi tava ocinyi ciñi\nTe calio ci nuila.\nOluali lulo lu pita;\nLacimue lu muisa.\nEsumuluho liocili\nNda sanga kekulusu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_64, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1868, position: 1, content: "Yeveleli kua tunda ondaka\nKomindikiso ya Yesu;\nYa lulumisa olomunda\nYa sitikila kovailu;\nCa maliwa; ca maliwa;\nOyo ondaka  a liyuila;\nPa fulila ohali yosi,\nOpo Yesu wa fila.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_65, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1869, position: 2, content: "Ca maliwa; ondaka yaco\nYa sanjuisa ocili.\nYesu muele o sumuluisa\nAsumuluho ka vapui.\nCa maliwa; ca maliwa;\nOndaka yahe yi patekeli,\nYesu wa fa kekulusu,\nHa eci omuenyo ocali.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_65, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1870, position: 1, content: "Komindikiso Yesu a fila\nOsonde yahe ya mesekela,\nOyo ya sukula kutima,\nSole onduko ya'e.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_66, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1871, content: "Sole onduko ya'e, (2x)\nKomindikiso nda yelisua;\nSole onduko ya'e.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_66, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1872, position: 2, content: "Osonde yahe ya niamela,\nYa njelisa, nda yovoka,\nHaiyo ya mosuisa ovitua,\nSole onduko ya'e.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_66, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1873, position: 3, content: "Enju ku Yesu Upopeli\nWiha utima ho posoka,\nHu imbi lesanju loku ulula,\nSole onduko ya'e.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_66, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1874, position: 1, content: "Nda mola olui lua longa,\nLuosonde ya Yesu.\nMbuilamo ndi liyelisa,\nVosonde ya Yesu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_67, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1875, content: "Nda mola olui lua longa,\nLuosonde yu o njanguisa,\nKonele yahe ya tumuha;\nMbuilamo ndi liyelisa.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_67, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1876, position: 2, content: "Osonde yahe ndi yi yangela,\nOsonde ya Yesu.\nCimosi ndi ci tambula,\nOsonde ya Yesu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_67, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1877, position: 3, content: "Kovailu mbuala via yela,\nLosonde ya Yesu.\nKowiñi una wa fina,\nLosonde ya Yesu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_67, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1878, position: 1, content: "Ekulusu ndi li yolela,\nLi kala kolotembo ño.\nKokualio Yesu wa mopela,\nNda muilako omuenyo.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_68, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1879, position: 2, content: "Opo nala ño ohali\nUtima wa tokotelua.\nKekulusu si tundi vali,\nLi kuete esanju lombembua.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_68, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1880, position: 3, content: "Eci nomela kutanya,\nOnjila yi yelako pe;\nKekulusu kuatua ulamba,\nWa sandola owelema.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_68, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1881, position: 4, content: "Kuosi ngenda, ekulusu\nLi sanjuisa ocili.\nUtima u yela; mua fetika,\nOnjolela ka yipui.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_68, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1882, position: 1, content: "Kimbo lina li kola,\nPokati kema lia lua,\nKua pondiwile omunu.\nAme a fila.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_69, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1883, position: 2, content: "Kutue olosongo,\nVetimba ovapute,\nVo tuika ekulusu.\nAme a fila.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_69, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1884, position: 3, content: "Kumue lovimunu,\nVo tuala kepondelo,\nVo nyoñamisa vuti.\nAme a fila.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_69, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1885, position: 4, content: "Yesu, Cime comuenyo,\nWa panga oku fila,\nHa muisa omuenyo ko pui.\nAme a fila.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_69, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1886, position: 5, content: "Oco Yesu a ndingila,\nLamevo ndinga waye,\nNdu vumba locisola,\nAme a fila.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_69, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1887, position: 1, content: "Yesu wa tula omuenyo\nHa imula akandu.\nOsonde wa yi pesila\nEyovo liomanu.\nOmuenyo ko pui wa tu iha.\nEtu tuo wiha nye?", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_70, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1888, position: 2, content: "Kilu, konjo ya Isia’e,\nWa kaile lulamba.\nWa kala palo posi,\nLongongo lonjala.\nUwale waye wo siapo.\nEtu tu siapo nye?", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_70, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1889, position: 3, content: "Wa yeva ovayonjo.\nWa mola elamba.\nHaeye wa tu mahela\nOsongo yokufa.\nOhali wa tu talela.\nTu u lingilavo nye?", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_70, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1890, position: 4, content: "A Yesu, a Cime cetu,\nOve ukuahenda.\nWa tu yovola ocali\nKakandu lokufa.\nTu litumbika kokuove.\nTu ku iha itima.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_70, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1891, position: 1, content: "Ku kasi ono yeyuka\nLosonde ya Yesu.\nU owilamo waliña,\nOyela kakandu.\nOyela kakandu osi,\nOyela kakandu.\nU owilamo waliña,\nOyela kakandu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_71, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1892, position: 2, content: "Yesu Osoma yinene\nYa tunda kovailu.\nWa lilekisa letimba\nHa popela omanu.\nHa popela omanu vaye,\nHa popela omanu.\nWa lilekisa letimba\nHa popela omanu.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_71, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1893, position: 3, content: "Omola a Suku wa nena\nEyovo komanu.\nOmanu vosi votava\nVa mola eyovo.\nVa mola eyovo liaye,\nVa mola eyovo.\nOmo liohenda ya Suku\nVa mola eyovo.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_71, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1894, position: 4, content: "Vosi nda tuendi ketavo\nLiu wa tu popela.\nLocili tu sivayi ño\nOsoma yomuenyo.\nOsoma yomuenyo Suku,\nOsoma yomuenyo.\nLohenda Suku opopela;\nOsoma vomuenyo.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_71, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1895, position: 5, content: "Ndaño veyambo mu uhila\nElimi liositu.\nUtima wange usivaya\nYesu Onjovoli.\nYesu Onjovoli yange\nYesu Onjovoli.\nUtima wange usivaya\nYesu Onjovoli.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_71, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1896, position: 1, content: "Ndaño lohali ku konyoha,\nSuku okutata.\nVavava ahe ocisola,\nSuku oku tata.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_72, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1897, content: "Suku oku tata,\nKuosi okasi palo posi;\nSuku oku tata.\nSuku oku tata.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_72, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1898, position: 2, content: "Eci utima wa tunguka,\nSuku oku tata.\nNda ci katuka cikola,\nSuku oku tata.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_72, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1899, position: 3, content: "Cosi wa suka oku muisa,\nSuku oku tata,\nU wo kolela o telisa,\nSuku oku tata.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_72, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1900, position: 4, content: "Eci uyamba ukuvala,\nSuku oku tata,\nEye oku lemba kutima,\nSuku oku tata.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_72, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1901, position: 5, content: "Nda kuiya eci nda kuiya oco,\nSuku oku tata.\nKokuahe ka kunamele ño,\nSuku oku tata.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_72, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1902, position: 1, content: "A Yesu, ove hũ kolela;\nLomue vali nji,\nOco mole eyovo lina\nLi enda hũ.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_73, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1903, position: 2, content: "Ndi ku kolela; wa ngecela,\nOvakandu a lema.\nNyihe unu; ndinge ohenda\nYa lova.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_73, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1904, position: 3, content: "Ndi ku kolela; ndo njelise,\nÑasi leviho.\nNdi ku kolela; ndo nuwise,\nVia Suku.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_73, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1905, position: 4, content: "Ove Usungu, hu kolela,\nHa ku songuila.\nOve uhuasi, o ngavela\nVia ñamba.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_73, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1906, position: 5, content: "A Yesu, ove ukuangusu;\nKu ka nokoke,\nSanga ndopo ndi konyoha;\nÑolise.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_73, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1907, position: 1, content: "Kilu liokamunda,\nKuna kekulusu,\nOcilai cohali losõi,\nPuai sole ekulusu\nNdu kuesanju lialua,\nMomo lia ima akandu oluali.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_74, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1908, content: "Ame nolapo ekulusu\nToke njula ovanyali.\nAme ñuata kekulusu,\nOlio lia ndingila ulamba.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_74, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1909, position: 2, content: "Kuna kekulusu\nLia sepuisua calua,\nLia saluisa, lia ñomohisa.\nKameme ka Suku\nWa tundile kilu\nOku tu talela ohali.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_74, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1910, position: 3, content: "Haiko kekulusu\nKua peseka osonde\nYi kola yi tu komohisa\nYa Yesu muẽle\nOnjovoli yange\nWa ngecela akandu ange.", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_74, typeStanza: HymnsContentCode.VERSE),

    HymnsContent(id: 1911, position: 1, content: "Ohenda yalua ya Yesu,\nWa fila ame ke kulusu,\nOku mopela kokufa,\nHelie o yi sapula?", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_75, typeStanza: HymnsContentCode.VERSE),
    HymnsContent(id: 1912, content: "Helie o sapula ohenda? (2x)\nYalua ohenda yupopeli,\nHelie o yi sapula?", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_75, typeStanza: HymnsContentCode.CHOIR),
    HymnsContent(id: 1913, position: 2, content: "Okopo, Yesu wa  nyuile,\nOhali yalua a tala,\nKekulusu oku mopela,\nHelie o yi sapula?", hymnsNumber: UmHymnsNumberSeeder.OTOKUA_LOKUFA_KUA_YESU_75, typeStanza: HymnsContentCode.VERSE),
